CREATE PROCEDURE Proc_property_GetPaging (IN v_Offset int, IN v_Limit int, IN v_Sort varchar(100), IN v_Where varchar(1000))
SQL SECURITY INVOKER
COMMENT 'Lấy danh sách tài sản'
BEGIN
  -- =============================================
  -- Author:        TTDuc
  -- Created date:  10/08/2022
  -- Description:   Lấy danh sách tài sản và tổng số tài sản có phân trang
  -- Modified by:   
  -- Code chạy thử: CALL `misa.web07.hcsn2.ttduc`.Proc_property_GetPaging(0, 1000, NULL, NULL);
  -- =============================================


  -- kiểm tra xem @Where = '' thì gán @Where ='1=1' còn ngược lại thì giữ nguyên giá trị
  IF IFNULL(v_Where, '') = '' THEN
    SET v_Where = '1=1';
  END IF;

  -- kiểm tra điều kiện v_Sort = '' thì xét v_Sort = 'ModifiedDate DESC'
  IF IFNULL(v_Sort, '') = '' THEN
    SET v_Sort = 'ModifiedDate DESC';
  END IF;

  -- kiểm tra limit = -1 thì lấy tất cả bản ghi còn lại thì lấy theo số lượng limit
  IF v_Limit = -1 THEN
    SET @filterQuery = CONCAT('SELECT * FROM property WHERE ', v_Where, ' ORDER BY ', v_Sort);
  ELSE
    SET @filterQuery = CONCAT('SELECT * FROM property WHERE ', v_Where, ' ORDER BY ', v_Sort, ' LIMIT ', v_Offset, ',', v_Limit);
  END IF;

  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;

  SET @filterQuery = CONCAT('SELECT COUNT(PropertyID) FROM property WHERE ', v_Where);
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;
END
$$

